INSERT INTO `ps_category_lang` VALUES (1,1,1,'Root','','root','','',''),(1,1,2,'Baza','','baza','','',''),(2,1,1,'Home','','home','','',''),(2,1,2,'Strona główna','','strona-glowna','','',''),(3,1,1,'Żarówki LED','Odpowiednie oświetlenie czyni nas szczęśliwszymi (i sprawia, że nocą nie obijamy się o meble). Żarówki LED lubimy najbardziej, bo zużywają mniej energii i świecą nawet 20 lat. Dlaczego więc nie przejść na oświetlenie LED i akumulatorki do ładowania już dziś? Z pewnością okaże się to korzystne dla twojego portfela i rozjaśni przyszłość naszej planety.','zarowki-led','Meta title-Żarówki LED','Meta keywords-Żarówki LED','Meta description-Żarówki LED'),(3,1,2,'Żarówki LED','Odpowiednie oświetlenie czyni nas szczęśliwszymi (i sprawia, że nocą nie obijamy się o meble). Żarówki LED lubimy najbardziej, bo zużywają mniej energii i świecą nawet 20 lat. Dlaczego więc nie przejść na oświetlenie LED i akumulatorki do ładowania już dziś? Z pewnością okaże się to korzystne dla twojego portfela i rozjaśni przyszłość naszej planety.','zarowki-led','Meta title-Żarówki LED','Meta keywords-Żarówki LED','Meta description-Żarówki LED'),(4,1,1,'Inteligentne oświetlenie','Światło ma ogromny wpływ na nasze samopoczucie. Wiemy o tym, ponieważ poświęciliśmy mnóstwo czasu na badania oświetlenia i szukanie sposobów jak najlepszego wykorzystania światła w domu. Tak powstało inteligentne oświetlenie. Można je bezprzewodowo włączać i wyłączać, przyciemniać oraz zmieniać jego temperaturę i kolor z dowolnego miejsca w domu.','inteligentne-oswietlenie','Meta title-Inteligentne oświetlenie','Meta keywords-Inteligentne oświetlenie','Meta description-Inteligentne oświetlenie'),(4,1,2,'Inteligentne oświetlenie','Światło ma ogromny wpływ na nasze samopoczucie. Wiemy o tym, ponieważ poświęciliśmy mnóstwo czasu na badania oświetlenia i szukanie sposobów jak najlepszego wykorzystania światła w domu. Tak powstało inteligentne oświetlenie. Można je bezprzewodowo włączać i wyłączać, przyciemniać oraz zmieniać jego temperaturę i kolor z dowolnego miejsca w domu.','inteligentne-oswietlenie','Meta title-Inteligentne oświetlenie','Meta keywords-Inteligentne oświetlenie','Meta description-Inteligentne oświetlenie'),(5,1,1,'Oświetlenie dekoracyjne','Oświetlenie dekoracyjne ma charakter całoroczny – girlandy równie dobrze sprawdzają się w okresie świątecznym, jak i podczas letnich wieczorów na balkonie lub patio. Wybieraj spośród wielu różnych kolorów i stylów. Jesteśmy pewni, że znajdziesz tu coś w sam raz do swojego domu!','oswietlenie-dekoracyjne','Meta title-Oświetlenie dekoracyjne','Meta keywords-Oświetlenie dekoracyjne','Meta description-Oświetlenie dekoracyjne'),(5,1,2,'Oświetlenie dekoracyjne','Oświetlenie dekoracyjne ma charakter całoroczny – girlandy równie dobrze sprawdzają się w okresie świątecznym, jak i podczas letnich wieczorów na balkonie lub patio. Wybieraj spośród wielu różnych kolorów i stylów. Jesteśmy pewni, że znajdziesz tu coś w sam raz do swojego domu!','oswietlenie-dekoracyjne','Meta title-Oświetlenie dekoracyjne','Meta keywords-Oświetlenie dekoracyjne','Meta description-Oświetlenie dekoracyjne'),(6,1,1,'Lampy','Za pstryknięciem przełącznika lub puknięciem ekranu smartfona możesz całkowicie odmienić atmosferę panującą w pomieszczeniu. Przyda się spokojny, przytulny nastrój na wieczorne oglądanie filmu? Musisz dodać sobie animuszu, żeby energicznie rozpocząć dzień? Oświetlenie nastraja, uzupełnia wystrój wnętrza i oczywiście wszystko rozjaśnia. Znajdziesz u nas lampy, które sprawdzą się w całym domu – od podłogi po sufit.','lampy','Meta title-Lampy','Meta keywords-Lampy','Meta description-Lampy'),(6,1,2,'Lampy','Za pstryknięciem przełącznika lub puknięciem ekranu smartfona możesz całkowicie odmienić atmosferę panującą w pomieszczeniu. Przyda się spokojny, przytulny nastrój na wieczorne oglądanie filmu? Musisz dodać sobie animuszu, żeby energicznie rozpocząć dzień? Oświetlenie nastraja, uzupełnia wystrój wnętrza i oczywiście wszystko rozjaśnia. Znajdziesz u nas lampy, które sprawdzą się w całym domu – od podłogi po sufit.','lampy','Meta title-Lampy','Meta keywords-Lampy','Meta description-Lampy'),(7,1,1,'Oświetlenie zintegrowane','Zawieszone nad szafkami (albo ukryte pod nimi) oświetlenie kuchenne pomaga stworzyć odpowiedni nastrój, zwiększa funkcjonalność kuchni i podkreśla jej zabudowę. Wykonane w technologii LED listwy oświetleniowe, reflektory i oświetlenie szafek wspaniale uzupełniają wystrój kuchni, ale przede wszystkim pozwalają wszystko lepiej widzieć.','oswietlenie-zintegrowane','Meta title-Oświetlenie zintegrowane','Meta keywords-Oświetlenie zintegrowane','Meta description-Oświetlenie zintegrowane'),(7,1,2,'Oświetlenie zintegrowane','Zawieszone nad szafkami (albo ukryte pod nimi) oświetlenie kuchenne pomaga stworzyć odpowiedni nastrój, zwiększa funkcjonalność kuchni i podkreśla jej zabudowę. Wykonane w technologii LED listwy oświetleniowe, reflektory i oświetlenie szafek wspaniale uzupełniają wystrój kuchni, ale przede wszystkim pozwalają wszystko lepiej widzieć.','oswietlenie-zintegrowane','Meta title-Oświetlenie zintegrowane','Meta keywords-Oświetlenie zintegrowane','Meta description-Oświetlenie zintegrowane'),(8,1,1,'Oświetlenie łazienkowe','Oświetlenie łazienki pomaga w codziennych czynnościach, czy to w strojeniu min do lustra, ujarzmianiu niesfornych włosów, czy też w nocnych odwiedzinach w toalecie. Znajdziesz tu nowocześnie i tradycyjnie zaprojektowane lampy ścienne i sufitowe, oświetlenie szafek oraz lustra (aby oślepiający blask twojego odbicia nie raził w oczy).','oswietlenie-lazienkowe','Meta title-Oświetlenie łazienkowe','Meta keywords-Oświetlenie łazienkowe','Meta description-Oświetlenie łazienkowe'),(8,1,2,'Oświetlenie łazienkowe','Oświetlenie łazienki pomaga w codziennych czynnościach, czy to w strojeniu min do lustra, ujarzmianiu niesfornych włosów, czy też w nocnych odwiedzinach w toalecie. Znajdziesz tu nowocześnie i tradycyjnie zaprojektowane lampy ścienne i sufitowe, oświetlenie szafek oraz lustra (aby oślepiający blask twojego odbicia nie raził w oczy).','oswietlenie-lazienkowe','Meta title-Oświetlenie łazienkowe','Meta keywords-Oświetlenie łazienkowe','Meta description-Oświetlenie łazienkowe'),(9,1,1,'Oświetlenie ogrodowe','Szukasz oświetlenia albo girlandy do rozświetlenia swojego ogrodu? Coś tu chyba znajdziemy... Wybierz lampę o delikatnym, ciepłym blasku lub coś bardziej błyszczącego, aby w twoim salonie pod chmurką było jeszcze przyjemniej.','oswietlenie-ogrodowe','Meta title-Oświetlenie ogrodowe','Meta keywords-Oświetlenie ogrodowe','Meta description-Oświetlenie ogrodowe'),(9,1,2,'Oświetlenie ogrodowe','Szukasz oświetlenia albo girlandy do rozświetlenia swojego ogrodu? Coś tu chyba znajdziemy... Wybierz lampę o delikatnym, ciepłym blasku lub coś bardziej błyszczącego, aby w twoim salonie pod chmurką było jeszcze przyjemniej.','oswietlenie-ogrodowe','Meta title-Oświetlenie ogrodowe','Meta keywords-Oświetlenie ogrodowe','Meta description-Oświetlenie ogrodowe');
