INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Delivery','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),(1,2,1,'Dostawa','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<dl>\n<dd class=\"current\">\n<p>W przypadku zamówień powyżej 300 zł na terenie Polski <strong>dostawa gratis</strong>.</p>\n<p>Przy zamówieniu od 100 zł do 300 zł koszty dostawy wynoszą <strong>20 zł</strong>.</p>\n<p>W przypadku zamówienia poniżej 100 zł koszty dostawy wynoszą <strong>32 zł</strong>.</p>\n<p> </p>\n<p>Przy wyborze <strong>płatności \"za pobraniem\"</strong> do standardowych kosztów dostawy jest zawsze doliczona <strong>opłata pobraniowa w wysokości 8 zł </strong>. \"Płatność za pobraniem\" możliwa jest tylko i wyłącznie na terenie Polski do kwoty <strong>5.000 zł</strong>. Płatność przy odbiorze jest niemożliwa w przypadku artykułów o dużych gabarytach.</p>\n<p> </p>\n<p>Jeżeli zamówienie zawiera <strong>produkty o dużych gabarytach</strong>, do zamówienia zostanie doliczona <strong>dopłata w wysokości 112 zł</strong>.</p>\n</dd>\n</dl>','dostawa'),(3,1,1,'Terms and conditions of use','','Our terms and conditions of use','conditions, terms, use, sell','<h1 class=\"page-heading\">Terms and conditions of use</h1>\n<h3 class=\"page-subheading\">Rule 1</h3>\n<p class=\"bottom-indent\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\n<h3 class=\"page-subheading\">Rule 2</h3>\n<p class=\"bottom-indent\">Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniamю</p>\n<h3 class=\"page-subheading\">Rule 3</h3>\n<p class=\"bottom-indent\">Tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniamю</p>','terms-and-conditions-of-use'),(3,2,1,'Polityka prywatności','','Nasza polityka prywatności','conditions, terms, use, sell','<h2>Oświadczenie o ochronie danych</h2>\n<h3>Ochrona danych Lampy.pl</h3>\n<p>Ochrona prywatności jest dla nas niezmiernie ważna. W związku z tym dokonując wszelkich operacji związanych z przetwarzaniem danych osobowych (takich jak np. zbieranie, przetwarzanie czy przekazywanie danych),przestrzegamy przepisów europejskiego i krajowego prawa ochrony danych osobowych.</p>\n<p>Niniejsze oświadczenie umożliwi użytkownikom uzyskanie rozeznania w zakresie tego, które spośród danych osobowych są pozyskiwane na naszych stronach internetowych, w jaki sposób dane te są wykorzystywane i przekazywane, gdzie użytkownicy mogą uzyskać informacje w zakresie powierzonych danych oraz jakie środki bezpieczeństwa są przez nas podejmowane w celu ochrony danych.</p>\n<p>Poniżej lista z ważniejszymi uwagami:</p>\n<ol>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#1\">Osoba kontaktowa w sprawach dotyczących ochrony danych osobowych (administrator)</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#2\">Dane zbierane i przechowywane w celu sprawnego korzystania z witryny Lampy.pl </a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#3\">W jaki sposób dane są wykorzystywane i ewentualnie przekazywane podmiotom trzecim oraz w jakim celu to następuje</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#4\">Odesłania do zewnętrznych usług serwisów społecznościowych</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#5\">Środki bezpieczeństwa podejmowane w celu ochrony danych osobowych użytkownika</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#6\">Komunikacja komercyjna w formie wiadomości e-mail</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#7\">Blog z funkcją komentowania</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#8\">Czat na żywo</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#9\">Przechowywanie pliku cookie</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#10\">Wykorzystywanie usług marketingowych i analitycznych</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#11\">Prawa osób, których dane dotyczą</a></li>\n<li><a href=\"https://www.lampy.pl/informacje/polityka-prywatnosci.html#12\">Zmiany niniejszego Oświadczenia o ochronie danych</a></li>\n</ol>\n<div>\n<h3>1.Osoba kontaktowa w sprawach dotyczących ochrony danych osobowych (administrator)</h3>\n<p>Administratorem w rozumieniu przepisów o ochronie danych osobowych w odniesieniu do wszystkich procesów przetwarzania danych osobowych za pośrednictwem stron internetowych sklepu Lampy.pl jest::</p>\n<p><strong>Lampenwelt GmbH</strong> <br />Seelbüde 13<br />36110 Schlitz<br />Niemcy <br />Telefon: <br />Telefax: +49 (0) 6642 - 406 99 20 <br />E-Mail: <a href=\"mailto:info@lampy.pl\">info@lampy.pl</a></p>\n<p>Zgodnie z ustawowymi wymogami w przedsiębiorstwie został wyznaczony inspektor ochrony danych. Osoba ta pozostaje stale do dyspozycji użytkowników i jest osiągalna pod poniższym adresem i numerem telefonu:</p>\n<br />Karolina Burkard <br />Lampenwelt GmbH <br />Seelbüde 13, 36110 Schlitz <br />E-Mail: <a href=\"mailto:ochronadanychosobowych@lampy.pl\">ochronadanychosobowych@lampy.pl</a> <br />Tel:\n<p>Zapytania w przedmiocie ochrony danych osobowych oraz dochodzenia praw osób, których dane dotyczą (por. poniżej) należy kierować na wskazany wyżej adres do rąk inspektora danych.</p>\n</div>\n<h3>2. Dane zbierane i przechowywane w celu sprawnego korzystania z witryny Lampy.pl</h3>\n<p>Dane osobowe oznaczają informacje o zidentyfikowanej lub możliwej do zidentyfikowania osobie fizycznej („osobie, której dane dotyczą”), takie jak np. imię i nazwisko, adres, numer telefonu, data urodzenia jak również adres IP.</p>\n<p>Dane osobowe użytkowników są zbierane i wykorzystywane zasadniczo w zakresie niezbędnym dla zapewnienia dostępu do poprawnie funkcjonującej strony internetowej oraz dla dostarczania treści i świadczenia usług. Zbieranie i wykorzystywanie danych osobowych odbywa się co do zasady jedynie za zgodą użytkownika. Wyjątek stanowią przypadki, w których uprzednie uzyskanie zgody nie jest możliwe z przyczyn faktycznych, a przetwarzanie danych jest dopuszczalne na mocy przepisów ustawy.</p>\n<p><strong>Dane użytkowe</strong></p>\n<p>Podczas korzystania ze strony internetowej Lampy.pl zbierane są następujące dane, przy czym ich przechowywanie służy wyłącznie celom wewnętrznym dotyczącym systemu oraz celom statystycznym, tzw. dane użytkowe:</p>\n<p>Nazwy odwiedzanych stron, używanej przeglądarki, systemu operacyjnego i domeny żądającej dostępu, data i godzina dostępu, używane wyszukiwarki, nazwy pobranych plików i zanonimizowany adres IP klienta, dane e-commerce (zamówione produkty, cena, liczba)</p>\n<p>Dane te są również przechowywane w plikach logowania (logfiles) systemu. Nie dotyczy to adresów IP urządzenia użytkownika lub innych danych umożliwiających przyporządkowanie danych do użytkownika. Nie ma miejsca przechowywanie tych danych razem z innymi danymi osobowymi użytkownika.</p>\n<p>Podstawą prawną tymczasowego przechowywania danych jest art. 6 ust. 1 lit. f RODO.</p>\n<p>Tymczasowe przechowywanie adresu IP przez system jest konieczne w celu sprawnego korzystania ze strony internetowej. W tym celu adres IP urządzenia użytkownika musi być przechowywany na czas trwania sesji.</p>\n<p>Dane są usuwane, jak tylko nie są już niezbędne do celów, w których zostały zebrane. W przypadku utrwalania danych dla celów udostępniania strony internetowej ma to miejsce wraz z każdorazowym zakończeniem sesji.</p>\n<p>Utrwalanie danych służące udostępnianiu strony internetowej oraz przechowywanie danych w plikach logowania (logfiles) jest absolutnie konieczne. W konsekwencji użytkownikowi nie przysługuje w tym zakresie możliwość sprzeciwu.</p>\n<p><strong>Rejestracja</strong></p>\n<p>Na stronie internetowej użytkownik ma możliwość zarejestrowania się poprzez podanie danych osobowych. Wprowadzone dane zostają przesyłane i przechowywane przez przedsiębiorstwo. Przekazywanie danych osobom trzecim nie ma miejsca. W ramach procesu rejestracji przetwarzane są następujące dane:</p>\n<p>Pełne imiona i nazwisko klienta, wzgl. pełna nazwa oraz forma prawna firmy, adres e-mail, adres do rachunku oraz adres dostawy, opcjonalnie dane punktu odbioru paczek, numer telefonu i opcjonalnie data urodzenia.</p>\n<p>W momencie rejestracji zbierane są nadto następujące dane:</p>\n<p>login, data i godzina <br />data i godzina utworzenia profilu <br />adres IP</p>\n<p>Podstawą prawną przetwarzania danych w przypadku wyrażenia zgody użytkownika na przetwarzanie danych osobowych jest art. 6 ust. 1 lit. a RODO.</p>\n<p>Jeżeli rejestracja służy wykonaniu umowy, której stroną jest użytkownik, lub podjęciu działań prowadzących do zawarcia umowy, dodatkową podstawą prawną przetwarzania danych jest art. 6 ust. 1 lit. b RODO.</p>\n<p>Rejestracja użytkownika jest dobrowolna, umożliwia dogodny dostęp, wgląd w historię zamówień i dane osobowe zapisane w profilu klienta. Jeżeli użytkownik nie życzy sobie zakładania konta klienta, może bez przeszkód dokonać zamówienia jako gość.</p>\n<p>Dane są usuwane, jak tylko nie są już niezbędne do celów, w których zostały zebrane.</p>\n<p>W przypadku danych zebranych podczas procesu rejestracji dla celów wykonania umowy, której stroną jest osoba, której dane dotyczą, lub do podjęcia działań na żądanie osoby, której dane dotyczą, przed zawarciem umowy, dane są usuwane wówczas, gdy nie są one już niezbędne dla wykonania umowy. Również po zawarciu umowy może wystąpić konieczność przechowywania danych osobowych dotyczących strony umowy, aby spełnić obowiązki wynikające z umowy lub ustaw.</p>\n<p>Zobowiązania ciągłe wymagają przechowywania danych osobowych w okresie obowiązywania umowy. Nadto wymagane jest przestrzeganie terminów gwarancyjnych oraz przechowywanie danych dla celów podatkowych. To, jakie okresy przechowywania muszą zostać zachowane, nie jest ogólnie stwierdzalne lecz podlega ustaleniu w każdym poszczególnym przypadku w stosunku do każdej zawartej umowy i każdej strony umowy.</p>\n<p>Użytkownik ma możliwość w dowolnym momencie pod adresem <a href=\"mailto:ochronadanychosobowych@lampy.pl\">ochronadanychosobowych@lampy.pl</a> usunąć swój profil lub dokonać zmian w przechowywanych danych, które go dotyczą.</p>\n<p>Jeżeli dane osobowe są niezbędne do wykonania umowy lub do podjęcia działań prowadzących do zawarcia umowy, wcześniejsze usunięcie danych jest możliwe, o ile usunięcie danych nie koliduje z wiążącymi zobowiązaniami umownymi lub ustawowymi.</p>','polityka-prywatnosci'),(4,1,1,'About us','','Learn more about us','about us, informations','<h1 class=\"page-heading bottom-indent\">About us</h1>\n<div class=\"row\">\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-block\">\n<h3 class=\"page-subheading\">Our company</h3>\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididun.</strong></p>\n<p>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam. Lorem ipsum dolor sit amet conse ctetur adipisicing elit.</p>\n<ul class=\"list-1\">\n<li><em class=\"icon-ok\"></em>Top quality products</li>\n<li><em class=\"icon-ok\"></em>Best customer service</li>\n<li><em class=\"icon-ok\"></em>30-days money back guarantee</li>\n</ul>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Our team</h3>\n<p><strong class=\"dark\">Lorem set sint occaecat cupidatat non </strong></p>\n<p>Eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo.</p>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Testimonials</h3>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">“</span>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim.<span class=\"after\">”</span></div>\n</div>\n<p><strong class=\"dark\">Lorem ipsum dolor sit</strong></p>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">“</span>Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod.<span class=\"after\">”</span></div>\n</div>\n<p><strong class=\"dark\">Ipsum dolor sit</strong></p>\n</div>\n</div>\n</div>','about-us'),(4,2,1,'O nas','','Dowiedz się o nas','about us, informations','<div>\n<div class=\"widget-raw-html block block-\">\n<div id=\"widget-raw-html20543390351638015046\" class=\"widget-inner block-content\">\n<p><i>Sklep internetowy swiatleks należy do niemieckiej firmy Lampenwelt GmbH. Historia firmy Lampenwelt GmbH sięga 1999 roku. Założycielami są dwaj bracia Thomas i Andreas Rebmann. Obydwaj wiedzą dzisiaj, że podjęli właściwą decyzję decydując się na przedsięwzięcie . Stworzyli firmę w odpowiednim czasie i podjęli współpracę z odpowiednimi ludźmi.</i></p>\n</div>\n</div>\n</div>\n<p>Prawie 40 000 lamp i źródeł światła, ponad 500 zmotywowanych i kompetentnych pracowników, 15.000 metrów kwadratowych powierzchni biurowej i magazynowej, ponad 10 lat doświadczenia w sprzedaży produktów i wiele pozytywnych opinii w programie wiarygodne opinie. Powyższe cyfry są rezultatem historii sukcesu firmy lampy.pl wiodącego sklepu internetowego z branży oświetleniowej.</p>\n<p>W 1999 roku założyciel i dyrektor zarządzający Thomas Rebmann po zdobyciu wykształcenia w kierunku Elektrotechnik zaczął sprzedawać lampy o najwyższej jakości na eBay-u. W tym czasie środki były ograniczone. Trzeba było improwizować, rozwijać własne pomysły i wykorzystywać maksymalnie kapitał – podejście te sprawiło, iż firma do dziś rozwija się bardzo dynamicznie. Inwestycja, która traktowana była jako dodatkowy zarobek stała się wielkim sukcesem za sprawą zrozumienia potrzeb klienta oraz bardzo korzystnej oferty. ,,W latach 90-tych handel internetowy był jeszcze w fazie początkowej. Jednak dzięki optymalnej obsłudze , wysokiej motywacji i dużej dawce wytrwałości udało się uzyskać zaufanie zarówno klientów jak i dostawców’’, wspomina początki Thomas Rebmann.</p>\n<p>W 2002 roku dla stale rosnącej liczby odbiorców indywidualnych i biznesowych produkty zostały umieszczone na pierwszej platformie internetowej. Po udanym początku, Thomas Rebmann postanowił w 2004 roku wraz z bratem Andreasem stworzyć spółkę cywilną: Rebmann systemy oświetleniowe. Inwestycje w nowe oprogramowanie sklepu, system planowania zasobów przedsiębiorstwa oraz intensywna praca nad dostosowaniem produktów do preferencji klienta sprawiły, iż w 2007 roku firma zmieniła status prawny ze spółki cywilnej na spółkę komandytową z udziałem spółki z o.o. jako komplementariusza.</p>','o-nas'),(5,1,1,'Secure payment','','Our secure payment method','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Visa/Mastercard/Paypal</h3>\n<p>About this service</p>','secure-payment'),(5,2,1,'Płatności','','Nasze płatności','secure payment, ssl, visa, mastercard, paypal','<p>Wygodna i sprawdzona metoda płatności polegająca na pobraniu pieniędzy z karty kredytowej (VISA, MasterCard). Podają Państwo numer karty kredytowej, datę ważności i kod autoryzacyjny. Dane te nie są zapisywane przez Sklep internetowy, tylko bezpośrednio przekazywane do BS PAYONE GmbH za pomocą 128-bitowego protokołu SSL. Karta kredytowa musi być zarejestrowana przez bank, który wystawił kartę kredytową, do procesu uwierzytelnienia klienta, poprzez bezpieczny protokół przyjęty przez organizacje płatnicze Visa (Verified by Visa) oraz MasterCard (MasterCard SecureCode). Zarówno w przypadku Verified by VISA jak i MasterCard Secure Code w trakcie przeprowadzania płatności zostaną Państwo automatycznie przekierowani na stronę swojego banku. Tam następuje identyfikacja klienta, zazwyczaj poprzez podanie hasła (np. kod SMS wysłany na Państwa numer telefonu komórkowego lub odczyt hasła wygenerowanego przez token). Jeśli tożsamość zostanie potwierdzona, wówczas następuje rezerwacja należnej kwoty na karcie kredytowej. Obciążenie karty kredytowej następuje z powodów technicznych bezpośrednio po wysłaniu zamówienia. Kilka minut później możemy opracować Państwa zamówienie.</p>\n<p>Ta prosta i szybka metoda płatności jest dla Państwa bezpłatna.</p>\n<p>Możliwa jest również płatność kartą debetową (Maestro). Po podaniu danych kwota rachunku zostanie odciągnięta z Państwa konta. Płatność kartą debetową jest bezpłatna tak samo jak w przypadku płatności kartą kredytową.</p>','platnosci');
