INSERT INTO `ps_info_lang` VALUES (1,1,1,'<h2>Custom Text Block</h2>\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetu</strong></p>\n<p>Sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit.</p>'),(1,1,2,'<h2 class=\"h2\">Najwyższej jakości lampy i oświetlenie - prawie 40 000 produktów - tylko w Światłeks!</h2>\n<p>Sklep Światłeks oferuje szeroki wybór lamp, oświetlenia dekoracyjnego i źródeł światła.</p>\n<p>Planują Państwo budowę domu, remont mieszkania, a może mają Państwo jedynie ochotę na zmiany? W naszym sklepie znajdziecie Państwo odpowiednie lampy i oświetlenie do każdego wnętrza</p>\n<p></p>\n<p>Odpowiednio dobrane światło podnosi jakość życia – dzięki odpowiednim lampom będą się Państwo lepiej czuć we własnych czterech ścianach. Światło tworzy piękną atmosferę – do dobrego samopoczucia, odprężenia i pracy. Właściwie wybrana lampa nada pomieszczeniu charakteru i stworzy w nim niepowtarzalny klimat. Dobrze dobrane żarówki chronią oczy przed szybkim zmęczeniem oraz podnoszą komfort. Z lampami ze sklepu internetowego Lampy.pl urządzą Państwo własne mieszkanie nastrojowo i pomysłowo.</p>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

